import React, { Component } from 'react';

const ServiceBtn = ({ position, top, left, bgcolor, width, height }) => (
  <button
    style={{
      position: position,
      top: top,
      left: left,
      backgroundColor: bgcolor,
      width: width,
      height: height
    }}
  >
    Services
  </button>
);

const PrixBtn = ({ position, top, left, bgcolor, width, height }) => (
  <button
    style={{
      position: position,
      top: top,
      left: left,
      backgroundColor: bgcolor,
      width: width,
      height: height
    }}
  >
    Services
  </button>
);

const PromotionBtn = ({ position, top, left, bgcolor, width, height }) => (
  <button
    style={{
      position: position,
      top: top,
      left: left,
      backgroundColor: bgcolor,
      width: width,
      height: height
    }}
  >
    Services
  </button>
);

export class Services extends Component {
  render() {
    return (
      <div>
        <div>
          <button></button>
          <button></button>
          <button></button>
        </div>
        <div>
          <img />
          <p></p>
        </div>
      </div>
    );
  }
}

export default Services;
